using System;
using System.Collections.Generic;
using System.Text;

namespace Deskberry.SQLite.Extensions
{
    public static class AvatarRoot
    {
        public static string Cats { get; } = @"";
        public static string Bird { get; } = @"";
        public static string Wolf { get; } = @"";
